// 

import axios from "axios";
import React, { useEffect, useState } from "react";
import Swal from 'sweetalert2';
import c5 from "../Assects/Advertising 5.png";
import c3 from '../Assects/Approval 3.png';
import c1 from '../Assects/Lawyer (1).png';
import c4 from "../Assects/World Connection 1.png";
import Add from "./add-comp";
import Footer from "./footer";
import './home.css';



function UserHome() {

     let [datas ,setdatas] = useState([])

    // const getHomePage = async () => {
    //     const token = localStorage.getItem('token');
    //     console.log("Token from localStorage:", token);

    //     try {
    //         const response = await axios
    //         .get("http://localhost:7000/home", {
    //             headers: { Authorization: `Bearer ${token}` }
    //         });
    //         console.log("Home Page Data:", response.data); 
    //     } catch (error) {
    //         console.error("Error fetching home page data:", error);
    //         alert("Failed to fetch home page data. Please check your login status.");
    //     }
    // };

       const getlawyers = async (req,res) => {
        await axios
        .get("http://localhost:7000/getverflawer")
        .then((res) => {
             console.log(res.data)
            setdatas(res.data)

        })
        .catch((err) => {
            console.log(`${err}`)
        })

       }
       const Ratings = ({ num }) => {
        const stars = [];

        for (let i = 0; i < num; i++) {
          stars.push(
            <span key={i}>
              <box-icon name='star' type='solid' animation='tada' color='#ffec00' ></box-icon>
            </span>
          );
        }
        console.log(stars)
        return <div>{stars}</div>;
      };

      const click = ()=> {
        Swal.fire({
            title: "Login Please",
            text: "That thing is still around?",
            icon: "question"
          });
      }

    useEffect(() => {
        getlawyers();
    }, []);

    return (
        <>
            <div className="head-add">
                <div>
                    <Add />
                    <div className="solo">
                        <p>Why Choose Us?</p>
                    </div>
                    <div >

                    </div>
                </div>

            </div>

                        <div className="down-add">

                            <div className="c-card">
                                <div className="le">
                                <p>Free Legal Advice Online
                                </p>
                                </div>
                            <div className="c-img">
                                <img src={c1}/>
                            </div>
                            </div>
                            <div className="c1-card">
                                <div className="le">
                                <p>Personalized Approach
                                </p>
                                </div>
                            <div className="c-img">
                                <img src={c3}/>
                            </div>
                            </div>
                            <div className="c2-card">
                                <div className="le">
                                <p>Clear Communication
                                </p>
                                </div>
                            <div className="c-img">
                                <img src={c4}/>
                            </div>
                            </div>
                            <div className="c3-card">
                                <div className="le">
                                <p>Proven Results
                                </p>
                                </div>
                            <div className="c-img">
                                <img src={c5}/>
                            </div>
                            </div>
            </div>
            <div className="solo">
                        <p>Top Rated Lawyers</p>
                    </div>

            <div className="down-add">

            {datas.map(value => (  
            <div class="card10">

             <div class="card10-border-top">
             </div>





            <div class="img">

            <img src={`http://localhost:7000/static/${value.originalname}`} style={{ maxWidth: '370px', maxHeight: '160px' }}/>
             </div>

            <span>{value.name}</span>

            <p class="job"> {value.location}</p>
            <p class="job"> {value.age}</p>
            <p class="job">Senior Lawyer</p>
            <button onClick={click}> View
            </button>


              </div>
              ))}

            </div>
            <div className="c-h">
                <h2>Our Practice Areas</h2>


            </div>
            <div className="down-add">
            <div className="issue">
                <div className="align">
